            isLoaded: true,
            isLoggedIn: true,
        }
    }
    render() {
        return (
            <div>
                <h1>{this.state.isLoaded ? 'Data loaded!' : 'Loading ...'}</h1>

            </div>
        )
    }
}

export default NestingComponents
